import './App.css';

function App() {
  return (
    <div className="App">
      <audio id="audio" loop autoPlay> 
        <source src="/music/the_unforgiven.mp3" type="audio/mpeg"/>
      </audio>
      <header className="App-header">
        <h1>New Blood Joins This Earth</h1>
        <h4>A retrospective on the Metallica Blacklist</h4>
      </header>
      <p>When I first started college, everyone and their mother seemed to be putting out a Metallica cover. From those I followed on Spotify: St. Vincent, Cage the Elephant, Royal Blood. The first two or three I shrugged off as a funny coincidence. A couple more and I began to figure something was up. </p>
      <p>It was September 2021, thirty years after the release of Metallica's eponymous "Black Album," and that fall I sat down to listen to the band's first release since I started listening to them: <i>The Metallica Blacklist,</i> a compilation of fifty-three covers to commemorate the anniversary of the album that launched metal into the mainstream.</p>
      <p>
When a band releases a self-titled album, it's a manifesto, a declaration of "This is who we are." Some bands debut with their opus eponymous. Others drop it midway through their discography, a pivot point, a clean slate to announce their new identity going forward. Metallica is an example of the latter. 
      </p>
    </div>
  );
}

export default App;
